'milestone',0),(21,'2007','JUL 2007, Indonesia, 4 LILY (Lily) stores in SOGO Department Store.\r\n<br/><br/>\r\nSEP 2007, Russia, the only Chinese brand on Buybrand show, launching THE 2008  FALL/WINTER COLLECTION .\r\n<br/><br/>\r\nDEC 2007, Russia, LILY (Lily)  opened Russian Branch, BOTH THE first corp overseas, AND THE first expansion INTO THE overseas market via direct management model, marking a new stage of Lily overseas development.',NULL,'en','2014-06-22 14:27:50','2014-06-22 14:27:50',NULL,1,'milestone',0),(22,'2008','FEB 2008, Germany, CPD Exhibition, the only Chinese brand allowed in “GLOBALHALL”, launching THE 2008 FALL/WINTER COLLECTION .',NULL,'en','2014-06-22 14:28:41','2014-06-22 14:28:41',NULL,1,'milestone',0),(23,'2010','MAR 2010, Shanghai, first flagship store in Huaihai Road. 270 Sq..\r\n<br/><br/>\r\nAUG 2010, Indonesia, CP store grand opening.  \r\n<br/><br/>\r\n2010, Russia VIVA, petrozavodsk, kashira and krasnoyarsk 3 stores opening.',NULL,'en','2014-06-22 14:28:59','2014-06-22 14:28:59',NULL,1,'milestone',0),(24,'2011','2011, Shanghai, 500 Sq flagship store opening in Nanjing Rd.\r\n<br/><br/>\r\nDEC 2011,  China Retail Eco Innovation Forum',NULL,'en','2014-06-22 14:29:13','2014-06-22 14:29:13',NULL,1,'milestone',0),(25,'2012','JUN 2012, LILY 10-year anniversary & winter collection launch.',NULL,'en','2014-06-22 14:29:20','2014-06-22 14:29:20',NULL,1,'milestone',0),(26,'2013','OCT 2013, Starring with   top 30 global supermodels, cooperating with Barbara Palvin for 2014 campaign.\r\n<br/><br/>\r\nNOV 2013, brand awareness ranks top 3 of Shanghai in the professional apparel market.\r\n',NULL,'en','2014-06-22 14:29:33','2014-06-22 14:29:33',NULL,1,'milestone',0),(27,'2000','2000年5月，上海，第一家LILY(Lily)专卖店。',NULL,'cn','2014-06-22 14:34:18','2014-06-22 14:34:18',NULL,1,'milestone',0),(28,'2005','2005年秋冬，巴黎，第一家LILY(Lily)海外专卖店。\n<br /><br />\n2005年9月，沙特，第一家中东地区LILY(Lily)专卖店。',NULL,'cn','2014-06-22 14:35:30','2014-06-22 14:35:30',NULL,1,'milestone',0),(29,'2006','2006年3月，上海时装周开幕秀品牌，发布2006春夏新品。\n<br /><br />\n2006年9月23日，登上米兰时装周主秀场，发布2007春夏新品，入选该届时装周三大新锐设计师品牌。\n<br /><br />\n2006年11月，参加德国DOSELDUF时装展，发布2007秋冬新品。',NULL,'cn','2014-06-22 14:35:58','2014-06-22 14:35:58',NULL,1,'milestone',0),(30,'2007','2007年7月，印度尼西亚sogo百货，开设4家LILY(Lily)专卖店。\r\n<br/><br/>\r\n2007年9月，参加俄罗斯buybrand展，展会唯一中国品牌，并发布2008秋冬流行趋势。\r\n<br/><br/>\r\n2007年12月，成立LILY(Lily)俄罗斯分公司。LILY(Lily)在海外建立的首个品牌分支机构，首次采用公司直接管理模式发展海外市场。标志着品牌的海外拓展进入全新自主阶段。\r\n',NULL,'cn','2014-06-22 14:36:06','2014-06-22 14:36:06',NULL,1,'milestone',0),(31,'2008','2008年2月，参加德国CPD，该展会历史上唯一被组委会批准进入“GLOBALHALL”的中国品牌，发布2008秋冬新品。',NULL,'cn','2014-06-22 14:36:47','2014-06-22 14:36:47',NULL,1,'milestone',0),(32,'2010','2010年3月，上海淮海路首家270平米品牌旗舰店正式开业。\n<br/><br/>\n2010年8月，印尼雅加达CP店正式开业。\n<br/><br/>\n2010年，俄罗斯VIVA、petrozavodsk、kashira、krasnoyarsk三店陆续开业。',NULL,'cn','2014-06-22 14:37:06','2014-06-22 14:37:06',NULL,1,'milestone',0),(33,'2011','2011年，上海南京路500平米品牌旗舰店开业。\n<br/><br/>\n2011年12月，成功举办“中国零售业可持续发展创新模式”高峰论坛',NULL,'cn','2014-06-22 14:37:24','2014-06-22 14:37:24',NULL,1,'milestone',0),(34,'2012','2012年6月，Lily品牌10周年暨冬季新品发布',NULL,'cn','2014-06-22 14:37:32','2014-06-22 14:37:32',NULL,1,'milestone',0),(35,'2013','2013年10月，携手全球排名前30超模，Barbara Palvin合作2014年度广告大片<br/><br/>\n2013年11月，品牌知名度在上海少淑女装市场进入前三',NULL,'cn','2014-06-22 14:37:45','2014-06-22 14:37:45',NULL,1,'milestone',0),(36,'2014','2014年3月，中国商业地产年会，获得“中国商业地产优秀合作品牌”<br/><br/>\n2014年3月，国外市场第57家品牌店铺在东欧开业',NULL,'cn','2014-06-22 14:38:20','2014-06-22 14:38:20',NULL,1,'milestone',0),(37,'2014','MAR 2014, “Excellent China  Commercial Real Estate Cooperative Brand” award in China Commercial Real Estate Association Annual Forum.<br/><br/>\nMAR 2014, the 57th overseas store launched in East Europe.',NULL,'en','2014-06-22 14:38:58','2014-06-22 14:38:58',NULL,1,'milestone',0),(38,'中国零售业可持续发展创新模式高峰论坛','<p>&ldquo;中国零售业可持续发展创新模式高峰论坛&rdquo;是由上海丝绸集团品牌发展有限公司（Lily品牌）主办，中国商业地产协会、第一财经频道/第一地产、搜狐网财经频道、零点研究咨询集团协办的一场零售业高峰论坛。论坛以&ldquo;店商vs电商：商机再造，谁主未来？&rdquo;为主题，汇聚了来自全国的近400名企业家领袖、行业专家、电商精英及各界媒体，针对当下中国零售业面临的全新商业格局进行探讨辨析，为实体零售业的未来发展出谋献策。</p>',NULL,'cn','2014-06-22 14:43:04','2014-06-22 14:43:04',NULL,1,'news',0),(41,'China Retail Eco Innovation Forum','','','en','2014-06-22 14:43:04','2014-06-26 18:35:00','',1,'news',0),(45,'GARDEN','','','en','2014-06-25 22:10:27','2014-06-27 10:54:29','',1,'lookbook',0),(47,'MODERN ART','','','en','2014-06-25 22:35:37','2014-06-27 10:53:49','',1,'lookbook',0),(48,'OCEAN','','','en','2014-06-25 22:36:19','2014-06-27 10:55:28','',1,'lookbook',0),(49,'Streetsnap','','','en','2014-06-26 08:54:23','2014-06-26 22:53:37','',1,'streehot',0),(57,'Lookbook','','','en','2014-06-26 16:49:18','2014-06-28 00:14:20','',1,'lookbook_gallery',0),(58,'Lookbook2',NULL,NULL,'en','2014-06-26 17:51:40','2014-06-26 18:09:07','',0,'lookbook_gallery',0),(59,'测试 lookbook item',NULL,NULL,'en','2014-06-26 18:03:01','2014-06-26 18:03:01','',1,'lookbook',0),(60,'测试 Lookbook Item',NULL,NULL,'en','2014-06-26 18:05:55','2014-06-26 18:05:55','',1,'lookbook',0),(61,'测试 lookbook item',NULL,NULL,'en','2014-06-26 18:07:13','2014-06-26 18:07:13','',1,'lookbook',0),(62,'测试',NULL,NULL,'en','2014-06-26 18:08:31','2014-06-26 18:08:31','',1,'lookbook',0),(63,'测试 Lookbook Item',NULL,NULL,'en','2014-06-26 18:09:01','2014-06-26 18:09:01','',1,'lookbook',0),(64,'ggjhghghjg',NULL,NULL,'en','2014-06-26 18:39:53','2014-06-26 23:01:02','',0,'lookbook_gallery',0),(65,'HSd',NULL,NULL,'en','2014-06-26 18:43:51','2014-06-26 18:43:51','',1,'lookbook',0),(66,'Streesnap',NULL,NULL,'cn','2014-06-26 22:57:34','2014-06-26 22:57:34','',1,'streehot',0),(67,'Job TEst','Job TEst',NULL,'en','2014-06-27 12:25:17','2014-06-27 13:12:10','',0,'job',0),(68,'销售管培生','1.大专及以上学历，专业不限； \n2.时尚敏感度强，追求完美；3.具有良好的沟通和独立思考能力。',NULL,'cn','2014-06-27 13:10:14','2014-06-27 13:10:14','',1,'job',0),(69,'助理陈列师','1.本科及以上学历，服装设计、形象造型设计等相关专业；\n2.接受过正规的形象管理培训，具有一对一的设计能力；\n3.五官端正，女性要求160cm以上、男性要求170cm以上。',NULL,'cn','2014-06-27 13:10:36','2014-06-27 13:10:36','',1,'job',0),(70,'空间设计师助理',